object Solution {
    def countInterestingSubarrays(nums: List[Int], modulo: Int, k: Int): Long = {
        var count = 0L
        val n = nums.length
        for (start <- nums.indices) {
            var cnt = 0
            for (end <- start until n) {
                if (nums(end) % modulo == k) cnt += 1
                if (cnt % modulo == k) count += 1
            }
        }
        count
    }
}
